-- ----------------------------
-- Table structure for eload_abc_index_keywords
-- ----------------------------
DROP TABLE IF EXISTS `eload_abc_index_keywords`;
CREATE TABLE `eload_abc_index_keywords` (
  `keyword_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `keyword` varchar(100) NOT NULL DEFAULT '' COMMENT '关键字',
  `keyword_length` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '关键字长度',
  `goods_num` mediumint(6) unsigned NOT NULL DEFAULT '0' COMMENT '商品数',
  `cat_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '关键词所属分类ID',
  `top_cat_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '关键词所属分类顶级id',
  `description` text NOT NULL COMMENT '关键词描述',
  `web_title` varchar(500) NOT NULL DEFAULT '' COMMENT '网站标题',
  `meta_keyword` varchar(500) NOT NULL DEFAULT '' COMMENT 'meta关键字',
  `meta_description` varchar(500) NOT NULL DEFAULT '' COMMENT 'meta描述',
  `word_count` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '单词数',
  `is_preserve` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否无条件保留,0:否;1:是',
  `is_user_search` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否用户搜索关键字,0:否;1:是',
  `last_update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新时间,供增量索引',
  `recommend` tinyint(1) DEFAULT '0' COMMENT '推荐关键词1为推荐0为普通',
  `is_exclude_words` tinyint(1) NOT NULL DEFAULT '0' COMMENT '排除某些单词(比如Men,Mens等)',
  `lang` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '多语言标识0:英语1:法语',
  `search_cat` varchar(500) DEFAULT '' COMMENT '指定搜索词在指定的分类下搜索',
  `exclude_goods_sn` text COMMENT '排除SKU',
  `is_show` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:关闭 1:开启',
  `monthly_volume` text NOT NULL COMMENT '月流量数据',
  `is_google_adwords` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否Adwords查询',
  `adwords_last_update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新时间,供增量索引',
  PRIMARY KEY (`keyword_id`),
  UNIQUE KEY `unique_keyword_lang` (`keyword`,`lang`),
  KEY `last_update_time` (`last_update_time`),
  KEY `cat_id` (`cat_id`,`goods_num`,`word_count`,`keyword_length`),
  KEY `lang` (`lang`)
) ENGINE=InnoDB AUTO_INCREMENT=222463 DEFAULT CHARSET=utf8 COMMENT='abc关键字表';

